import React from 'react';
import './Menu.css';

const Menu = () => {
  return (
    <div className="menu">
        <button className="option"  >/Init</button>
        <button className="option"  >/Intro</button>
        <button className="option"  >/Alfa</button>
        <button className="option"  >/Team</button>
    </div>
  );
};

export default Menu;
